import React from "react";
import { Link, BrowserRouter } from "react-router-dom";
import "./App.css";
function App() {
  return (
    <BrowserRouter>
      <div id="xxx">
        <header>
          <div>
            <button>&#9776;</button>
            <Link to="/">amazona</Link>
          </div>
          <div>
            <Link to=""></Link>
          </div>
        </header>
      </div>
    </BrowserRouter>
  );
}

export default App;
